import React, { Component } from 'react';
import Home from './Home';
import { Redirect } from 'react-router-dom';

export default class Devid extends React.Component {
  constructor(props) {
    super(props);
    this.state = {devid: ''};
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }



  handleChange(event) {
    this.setState({devid: event.target.value});
  }

  handleSubmit(event) {
    //alert('A name was submitted: ' + this.state.devid);
    event.preventDefault();

  }

  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <label>
          Name:
          <input type="text" value={this.state.value} onChange={this.handleChange} />
        </label>
        <input type="submit" value="Submit" Route exact path = "/" component={Home}>
        <Redirect to='/url'/>
            <switch>
                <Link to="/" exact component={Home}/>
            </switch>

        </input>
      </form>
    );
  }
}
